      SELECT DISTINCT * FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT col0 / + + 6 - - + 26 IN ( ( + - col2 ) + - + 87, col1 - + 30, + ( + - col0 ) - col2 );
  - name: tab1

